import React from "react";
import Form from "../components/questions/Form";
import { Button, Box } from "@mui/joy";
import { Logo } from "../components/Logo";
import { Footer } from "../components/footer";
export function Home({ quizStatus, setQuizStatus }) {
  return (
    <div>
      <div
        className={`p-[4rem ${
          quizStatus ? "pt-[0rem]" : "pt-[16rem]"
        } h-screen w-full flex flex-col justify-center items-center`}
      >
        <Logo />
        {quizStatus ? (
          <div className="text-center">
            <div className="leading-10">
              <h2>Welcome back, {localStorage.getItem("byte_name")}</h2>
              <div>What would you like to do?</div>
            </div>
            <div className="flex">
              <Button variant="soft" className="h-[15rem]"></Button>
            </div>
          </div>
        ) : (
          <Form setQuizStatus={setQuizStatus} />
        )}
        <Button
          variant="soft"
          color="primary"
          bgColor="primary"
          onClick={() => {
            window.location.assign("/menu");
          }}
        >
          View Menu
        </Button>
      </div>

      <Footer />
    </div>
  );
}
